import React, { useState } from "react";
import Account from "./Routes/Account";
import Pages from "./Routes/Pages";

const App = () => {

  const [show, setShow] = useState(true);
  let buttonText = show ? <Account/> : setShow(false);
  return (
    <>
    {buttonText}
    </>
  );
};

export default App;
